export function inputQuestion(values) {
    return {
        type: "INPUT_QUESTION",
        payload: values
    };
}

export function editQuestion(editedQuestion) {
    const {index, ...question} = editedQuestion;
    console.log(question);
    console.log(index);

    return {
        type: "EDIT_QUESTION",
        payload: question,
        index: index
    };
}

export function deleteQuestion(index) {
    return {
        type: "DELETE_QUESTION",
        index: index
    };
}
